package main

import (
	"bytes"
	"compress/gzip"
	"encoding/base64"
	"fmt"
	"io"
	"math/rand"
	"strings"
)

const englishNounsData = ""

const englishVerbsData = ""

const englishAdverbsData = ""

const englishAdjectivesData = ""

func getEnglishVocabWord(partOfSpeech string) string {

	var vocabData string

	switch partOfSpeech {
	case "noun":
		vocabData = englishNounsData
	case "adjective":
		vocabData = englishAdjectivesData
	case "verb":
		vocabData = englishVerbsData
	case "adverb":
		vocabData = englishAdverbsData
	default:
		vocabData = "Invalid part of speech"
	}

	// Decode the base64 data.
	decoded, err := base64.StdEncoding.DecodeString(vocabData)
	if err != nil {
		panic(err)
	}

	// Decompress the data.
	readerGzip, err := gzip.NewReader(bytes.NewReader(decoded))
	if err != nil {
		panic(err)
	}
	defer func(readerGzip *gzip.Reader) {
		err := readerGzip.Close()
		if err != nil {
			fmt.Printf("Error closing the gzip reader")
		}
	}(readerGzip)

	uncompressed, err := io.ReadAll(readerGzip)
	if err != nil {
		panic(err)
	}

	// Split the uncompressed data into lines.
	lines := strings.Split(string(uncompressed), "\n")

	// Seeded at runtime
	// Seed the random number generator.
	//rand.Seed(time.Now().UnixNano())

	// Select a random word.
	index := rand.Intn(len(lines) - 1)

	randomWord := lines[index]

	//randomWordAlone := strings.Split(randomWordIndexed, "\t")[1]

	output := strings.TrimSpace(randomWord)

	return output
}
